function filter() {
  const map = {
    '=': {
      prefix: "",
      suffix: "",
    },
    lk: {
      prefix: "(like)",
      suffix: "_lk",
    },
    ain: {
      prefix: "(splitforin)",
      suffix: "_in"
    },
    datetime: {
      prefix: "(datetime)",
      suffix: "_gt"
    },
    nextday: {
      prefix: "(nextday)",
      suffix: "_lt"
    },
    gt: {
      prefix: "",
      suffix: "_gt"
    },
    ge: {
      prefix: "",
      suffix: "_ge"
    },
    lt: {
      prefix: "",
      suffix: "_lt"
    },
    le: {
      prefix: "",
      suffix: "_le"
    },
    ne: {
      prefix: "",
      suffix: "_ne"
    },
    nv: {
      prefix: "",
      suffix: "_nv"
    },
    nn: {
      prefix: "",
      suffix: "_nn"
    },
  };

  const { $filterMode, $data } = $node
  const data = $data[Object.keys($data)[0]]?.children?.map(item => {
    return {
      key: item.name,
      mode: '='
    }
  })
  const filterCondition = $filterMode ?? data
  return filterCondition?.reduce((result, item) => {
    const { prefix, suffix } = map[item.mode]
    let value = $parseValue(item.value) || $comp['Search']?.value?.[item.key]
    const newKey = prefix+item.key+suffix
      return {
        ...result,
        [newKey]: Array.isArray(value) ? value.join(',') : value,
      }
  }, {}) ?? {}
}

